import styled from "styled-components";

export const Container = styled.div`
  width: 100%;
  height: 100%;
  float: left;
  padding-top: 10px;
`;

export const Tabs = styled.ul`
  width: 45%;
  margin-right: 4%;
  margin-left: 1%;

  display: block;
  float: left;
  height: 100%;
`;

export const TextTabs = styled(Tabs)`
  border: 2px solid #2072d7b3;
  background-color: white;
  border-radius: 10px;
  padding: 10px;
`;
